import React from 'react';

const TweetTextList = ({tweets}) => (
    <div className="grid-container2">
        {tweets.map((thistweet, key) => 
        <>
        <div className="tweet" key={key}>
            <p>ID {thistweet.id}</p>
            <p>{thistweet.text}</p>
        </div>
        </>
        )}
    </div>
)

export default TweetTextList;
